import React, { useEffect, useState } from 'react'
import constant from './constants'

const { SCREEN_TEXT } = constant

const HomeSection = () => {
  const [a, b] = useState()
  const ggg = useGetBooks('Dracul')
  console.log(a)
  const fetchBooks = async () => {
    const res = await ggg()
    b(res)
  }

  useEffect(() => {
    fetchBooks()
  }, [])
  console.log(
    'fffffff',
    ggg().then((a: any) => console.log(a))
  )
  return (
    <section>
      <div>{SCREEN_TEXT.recentSearch}</div>
    </section>
  )
}

export default HomeSection
